            <tr>
                <td>{{ reservation.id }}</td>
                <td>{{ reservation.dateD ? reservation.dateD|date('Y-m-d') : '' }}</td>
                <td>{{ reservation.dateF ? reservation.dateF|date('Y-m-d') : '' }}</td>
